import './HomePage.css';
import items from './items.json';

function HomePage() {
  return (
    <div className="HomePage">
      {items.map( response => {
        return(
            <div className="box" key={response.name}>
                {response.name}
                <img src={response.picture} alt={response.name}/>
                <a href='https://www.linkpicture.com/view.php?img=LPic63238a877b4a8281243588'>
                  <img src='https://www.linkpicture.com/q/IMG_0254_3.jpg' type='image'/>
                </a>
            </div>
        )
      })}
    </div>
  );
}

export default HomePage;




